import React from 'react';
import {useSelector} from "react-redux";
import {start} from "../../actions/range";

const Range = () => {

    start();
    return (
        <div>
            <nav className="navbar navbar-light bg-light">
                <div className="container-fluid justify-content-start">
                    <button className="btn btn-outline-success" type="button">History</button>
                    <button className="btn btn-outline-success" type="button">Geography</button>
                    <button className="btn btn-outline-success" type="button">Biology</button>
                    <button className="btn btn-outline-secondary" type="button">Mixed quiz</button>
                </div>
            </nav>

        </div>
    );
};

export default Range;
